  false,\n\t\"url\": null,\n\t\"notes\": \"Hourly measurements made by selected ship
  sensors on the R/V Seward Johnson during the \"Investigating the Charleston Bump
  2003\" expedition sponsored by the National Oceanic and Atmospheric Administration
  (NOAA) Office of Ocean Exploration, August 2 through August 16, 2003. Measurements
  include ship's position and heading, air temperature, relative humidity, barometric
  pressure, wind speed and direction, depth, total solar irradiance, chlorophyll-a
  (fluorometer), sea surface temperature, and salinity. This data set was compiled
  from Virtual Instrument Data System (VIDS) ASCII files provided by the University
  of Miami Marine Technology Group at Harbor Branch Oceanographic Institution.\",\n\t\"owner_org\":
